template<class T> FILM<T>::
FILM()
    :filter_width((T)2,(T)2),filter(0),dither_amplitude(.5)
{
}
template<class T> FILM<T>::
~FILM()
{
}
template<class T> void FILM<T>::
Set_Resolution(const int pixels_width,const int pixels_height)
{
    T width_over_two=(T).5*width,height_over_two=(T).5*height;
    grid.Initialize(pixels_width,pixels_height,-width_over_two,width_over_two,-height_over_two,height_over_two,true);
    subpixel_grid.Initialize(2*pixels_width,2*pixels_height,-width_over_two,width_over_two,-height_over_two,height_over_two,true);
    colors.Resize(grid.Domain_Indices());
    weights.Resize(grid.Domain_Indices());
    alphas.Resize(grid.Domain_Indices());
    filter=0;
}
template<class T> void FILM<T>::
Print_Film_Clipped(const std::string& filename,const T gamma,const RANGE<VECTOR<int,2> >& box) const
{
    ARRAY<VECTOR<T,4> ,VECTOR<int,2> > clipped(box.min_corner.x,box.max_corner.x,box.min_corner.y,box.max_corner.y);
        for(int i=box.min_corner.x;i<=box.max_corner.x;i++) for(int j=box.min_corner.y;j<=box.max_corner.y;j++) clipped(i,j)=colors(i,j).Append(alphas(i,j))/weights(i,j);
    IMAGE<T>::Write(filename,clipped,gamma,dither_amplitude);
}
template<class T> void FILM<T>::
Generate_Samples(const RANGE<VECTOR<int,2> >& pixel_range,const CAMERA<T>& camera,ARRAY<SAMPLE>& samples)
{
    if(sampler==UNIFORM || sampler==JITTERED){
        for(int i=pixel_range.min_corner.x;i<pixel_range.max_corner.x;i++) for(int j=pixel_range.min_corner.y;j<pixel_range.max_corner.y;j++)
            Generate_Stratified_Sample_Points(VECTOR<int,2>(i,j),camera,samples);}
    else if(sampler==BEST_CANDIDATE){
        VECTOR<int,2> lengths=pixel_range.Edge_Lengths();
        TV2 pixel_left=grid.X(pixel_range.min_corner)-(T).5*grid.dX;
        TV2 pixel_span=grid.X(pixel_range.max_corner)+(T).5*grid.dX-pixel_left;
        T max_length=max(pixel_span.x,pixel_span.y);
        for(int i=0;i<best_candidate_sample_count;i++){
            SAMPLE sample;
            sample.time=0;
            sample.alpha=0;
            sample.film_position=max_length*TV2(best_candidate_samples[i][0],best_candidate_samples[i][1])+pixel_left;
            if(grid.domain.Lazy_Inside(sample.film_position)){
                sample.world_position=camera.focal_point+camera.horizontal_vector*sample.film_position[1]+camera.vertical_vector*sample.film_position[2];
                samples.Append(sample);}}}
}
template<class T> void FILM<T>::
Generate_Stratified_Sample_Points(const VECTOR<int,2>& pixel_index,const CAMERA<T>& camera,ARRAY<SAMPLE>& samples)
{
    if(use_four_subpixels){
        for(int quadrant=0;quadrant<4;quadrant++){
            TV2 subpixel_center=subpixel_grid.X(2*pixel_index+VECTOR<int,2>(quadrant/4,quadrant%4));
            for(int sample_index=1;sample_index<=samples_per_pixel;sample_index++){
                SAMPLE sample;
                sample.time=0;
                sample.alpha=0;
                if(sampler==JITTERED) sample.film_position=subpixel_center+random.Get_Uniform_Vector(-(T).5*subpixel_grid.dX,(T).5*subpixel_grid.dX);
                else sample.film_position=subpixel_center;
                sample.world_position=camera.focal_point+camera.horizontal_vector*sample.film_position[1]+camera.vertical_vector*sample.film_position[2];
                samples.Append(sample);}}}
    else{
        TV2 pixel_center=grid.X(pixel_index);
        for(int sample_index=1;sample_index<=samples_per_pixel;sample_index++){
            SAMPLE sample;
            sample.time=0;
            sample.alpha=0;
            if(sampler==JITTERED) sample.film_position=pixel_center+random.Get_Uniform_Vector(-(T).5*grid.dX,(T).5*grid.dX);
            else sample.film_position=pixel_center;
            sample.world_position=camera.focal_point+camera.horizontal_vector*sample.film_position[1]+camera.vertical_vector*sample.film_position[2];
            samples.Append(sample);}}
}
template<class T> void FILM<T>::
Add_Sample(const SAMPLE& sample)
{
    RANGE<VECTOR<int,2> > box(grid.Clamp_To_Cell(sample.film_position-effective_filter_width),grid.Clamp_To_Cell(sample.film_position+effective_filter_width));
    for(int i=box.min_corner.x;i<=box.max_corner.x;i++) for(int j=box.min_corner.y;j<=box.max_corner.y;j++){
        T weight=filter(sample.film_position-grid.X(i,j),effective_filter_width);
        colors(i,j)+=weight*sample.radiance;weights(i,j)+=weight;alphas(i,j)+=weight*sample.alpha;}
}
